import React, { useEffect, useState } from 'react';

function App() {
  const [data, setData] = useState({ taskCreated: [], date: "" });

  useEffect(() => {
    fetch('/')
      .then((res) => res.json())
      .then((jsonData) => setData(jsonData))
      .catch((err) => console.log(err));
  }, []);

  return (
    <div>
      {/* Render your data from the 'data' state */}
      <h1>{data.date}</h1>
      {/* Render your items from the 'data' state */}
      {data.taskCreated.map((item) => (
        <div key={item._id}>{item.name}</div>
      ))}
    </div>
  );
}

export default App;
